import React from 'react';
import c from './Dialogs.module.css';

const DialogItem = (props) =>{
    return(
        <div className={c.dialog}>
        {props.name}
    </div>
    );
}

const Dialogs = () => {
    return (
        <div className={c.dialogs}>
            <div className={c.dialogs_item}>
            <DialogItem name = 'Danon'/>
            <DialogItem name = 'Vanon'/>
            <DialogItem name = 'Vlad1'/>
            <DialogItem name = 'Vlad2'/>
            <DialogItem name = 'Vitalya'/>
            </div>
            <div>
                <div>hi</div>
                <div>How are u?</div>
                <div>I am ok</div>
            </div>
        </div>
    );
}
export default Dialogs;
